import React from "react";
import Navigation from "../components/Navigation";
import Hero from "../components/Hero";

const Home = () => {
  return (
    <div>
      <Navigation />
      <div className="heros">
        <Hero
          bgImage="../images/hero-background-image.jpg"
          className="hero hero1"
          h1Content={[
            { text: "Join the adventure" },
            { text: " with your friends!", className: "text-red-color" },
            { text: "It will be fun !" },
          ]}
        />
        <Hero
          bgImage="../images/hero-background-image.jpg"
          className="hero hero1"
          h1Content={[
            { text: "Join the adventure" },
            { text: " with your friends!", className: "text-red-color" },
            { text: "It will be fun !" },
          ]}
          pContent={[
            { text: "Join the adventure" },
            { text: " with your friends!", className: "text-red-color" },
            { text: "It will be fun !" },
          ]}
        />
      </div>
    </div>
  );
};

export default Home;
